import React from "react";
import { DataTable } from "primereact/datatable";
import { Column } from "primereact/column";

export function MitgliederTable(props) {
  return (
    <div className="border-solid m-auto w-11">
      <div className="card">
        <DataTable
          value={props.personen}
          size="small"
          selectionMode="single"
          selection={props.selectedPerson}
          sortField="NameGesamt"
          sortOrder={1}
          scrollable
          scrollHeight="35vh"

          onRowSelect={props.onRowSelect}>
          <Column
            field="NameGesamt"
            header="Name"
            style={{
              minWidth: "300px",
            }}
            sortable></Column>
          <Column
            field=""
            header="Verein"
            style={{
              minWidth: "50px",
            }}
            sortable></Column>
          <Column
            field="Pers_Strasse"
            header="Strasse"
            style={{
              minWidth: "200px",
            }}></Column>
          <Column
            field="Pers_PLZ"
            header="PLZ"
            style={{
              minWidth: "50px",
            }}></Column>
          <Column
            field="Pers_Ort"
            header="Ort"
            style={{
              minWidth: "200px",
            }}
            sortable></Column>
        </DataTable>
      </div>
    </div>
  );
}
